export function SlideComponent() {
    const settings = {
        dots: false,
        infinite: false,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        arrows: true,
    };
    return (
        <div className="container">
            <Slider {...settings}>
                <div>
                    <img src="man.jpg" alt="" />
                </div>
                <div>
                    <img src="man2.jpg" alt="" />
                </div>
                <div>
                    <img src="woman.jpg" alt="" />
                </div>
                <div>
                    <img src="woman2.jpg" alt="" />
                </div>
            </Slider>
        </div>
    );
